function draw()    -- Line    stroke(1, 0, 0)    strokeSize(10)    line(100, 50, 300, 125)    -- Rectangle    stroke(0, 1, 0)    strokeSize(5)    rect(100, 150, 200, 100)    -- Square    stroke(1, 0, 1)    strokeSize(5)    fill(1, 1, 0)    square(100, 300, 100)    -- Ellipse    stroke(0, 0.5, 1)    strokeSize(4)    fill(1, 1, 1)    ellipse(150, 525, 50, 80)    -- Circle    noFill()    stroke(0, 0, 0.5)    strokeSize(4)    circle(150, 525, 50)end